using System;
using System.Collections;
using System.IO;
using System.Linq;
using System.Threading;

class Program
{
    static string profilePath;
    #region Bytes
    static string userChrome = @"";
    static string userContent = @"";
    #endregion

    static void Main(string[] args)
    {
        Console.WriteLine("Install darker theme into Firefox? y/n");
        char.TryParse(Console.ReadLine().Trim(), out char c);
        if (c == 'y')
        {
            string roaming = Path.Combine(Environment.GetFolderPath(Environment.SpecialFolder.ApplicationData), @"Mozilla\Firefox\Profiles");
            if (Directory.Exists(roaming))
            {
                Console.WriteLine("Looking for Firefox profiles folder. Installing under default profile:");
                ICollection profilesList = Directory.EnumerateDirectories(roaming).Where(s => s.Contains("default")).ToArray();
                if (profilesList.Count > 0 && profilesList.Count < 2)
                {
                    foreach (string o in profilesList)
                    {
                        Console.WriteLine(o);
                        profilePath = o;
                    }
                }
                else
                {
                    Console.ForegroundColor = ConsoleColor.Red;
                    Console.WriteLine("No singular default profile found. Do you use Firefox Quantum? Or perhaps you need to launch Firefox. Either way, I can't find anything.");
                    Console.ResetColor();
                    Console.WriteLine("Press any key to exit.");
                    Console.ReadKey();
                    return;
                }
                Console.WriteLine("Writing file to profile.");
                Directory.CreateDirectory(profilePath + @"\chrome");
                if (!File.Exists(profilePath + @"\chrome\userContent.css") && !File.Exists(profilePath + @"\chrome\userChrome.css"))
                {
                    File.WriteAllBytes(profilePath + @"\chrome\userChrome.css", Convert.FromBase64String(userChrome));
                    File.WriteAllBytes(profilePath + @"\chrome\userContent.css", Convert.FromBase64String(userContent));
                    Console.ForegroundColor = ConsoleColor.Green;
                    Console.WriteLine("Success. Restart Firefox to see changes take effect. Exiting in 3 seconds...");
                    Console.ResetColor();
                    Thread.Sleep(3000);
                    return;
                }
                else
                {
                    Console.ForegroundColor = ConsoleColor.Red;
                    Console.WriteLine("userContent.css and userChrome.css already exist in your profile. Cancelling.");
                    Console.ResetColor();
                    Console.WriteLine("Press any key to exit.");
                    Console.ReadKey();
                    return;
                }

            }
        }
        else
        {
            Console.ForegroundColor = ConsoleColor.Red;
            Console.WriteLine("You declined. Please type 'y' (without the quotes) to install.");
            Console.ResetColor();
            Console.WriteLine("Press any key to exit.");
            Console.ReadKey();
            return;
        }
    }
}

